@vade , The zipmap option is used in the sklearn framework.

First, we loaded the booster with lightgbm, then we used the sklearn API of lightgbm to do: 

```
initial_type = initial_types=[('input', FloatTensorType([1, n_cols]))]
options = {id(model): {'zipmap': False}};
onnx = convert_sklearn(model, initial_types=initial_type, options=options)
```

@RandySheriffH, before we tried this zipmap option set to false, we tried to  dispose the result and call gc.collect(). It works and leaves memory flat, but (at least in our case) we cannot use it, since it increases running time of the program by a lot, which we cannot afford.
